import React, { useState } from "react";

function MainPage({ user }) {
  const [habits, setHabits] = useState([]);
  const [newHabit, setNewHabit] = useState("");

  const addHabit = () => {
    if (newHabit.trim() === "") return;
    // Each habit has name and days tracked
    setHabits([...habits, { name: newHabit, days: [false, false, false, false, false, false, false] }]);
    setNewHabit("");
  };

  const toggleDay = (habitIndex, dayIndex) => {
    const updated = habits.map((habit, i) => {
      if (i === habitIndex) {
        const newDays = [...habit.days];
        newDays[dayIndex] = !newDays[dayIndex];
        return { ...habit, days: newDays };
      }
      return habit;
    });
    setHabits(updated);
  };

  const removeHabit = (index) => {
    setHabits(habits.filter((_, i) => i !== index));
  };

  const daysOfWeek = ["Mon", "Tue", "Wed", "Thu", "Fri", "Sat", "Sun"];

  return (
    <div style={styles.container}>
      <h2 style={styles.title}>Habit Tracker</h2>
      <p style={styles.user}>Welcome, {user.email}</p>

      <div style={styles.addContainer}>
        <input
          style={styles.input}
          type="text"
          placeholder="Add new habit..."
          value={newHabit}
          onChange={(e) => setNewHabit(e.target.value)}
        />
        <button style={styles.addButton} onClick={addHabit}>Add Habit</button>
      </div>

      {habits.length === 0 && <p style={styles.noHabits}>No habits yet. Add one above!</p>}

      <div style={styles.habitList}>
        {habits.map((habit, hIndex) => (
          <div key={hIndex} style={styles.habitItem}>
            <span style={styles.habitName}>{habit.name}</span>
            <div style={styles.daysContainer}>
              {habit.days.map((done, dIndex) => (
                <div
                  key={dIndex}
                  onClick={() => toggleDay(hIndex, dIndex)}
                  style={{
                    ...styles.dayBox,
                    backgroundColor: done ? "#4CAF50" : "#eee",
                  }}
                >
                  {daysOfWeek[dIndex]}
                </div>
              ))}
            </div>
            <button style={styles.deleteButton} onClick={() => removeHabit(hIndex)}>X</button>
          </div>
        ))}
      </div>
    </div>
  );
}

const styles = {
  container: {
    width: "600px",
    margin: "30px auto",
    padding: "20px",
    border: "1px solid #ccc",
    borderRadius: "10px",
    boxShadow: "0px 0px 15px #aaa",
    fontFamily: "Arial, sans-serif",
    textAlign: "center",
  },
  title: {
    fontSize: "28px",
    marginBottom: "5px",
  },
  user: {
    fontSize: "16px",
    color: "#555",
    marginBottom: "20px",
  },
  addContainer: {
    display: "flex",
    justifyContent: "center",
    gap: "10px",
    marginBottom: "20px",
  },
  input: {
    flex: 1,
    padding: "10px",
    borderRadius: "5px",
    border: "1px solid #ccc",
    fontSize: "16px",
  },
  addButton: {
    padding: "10px 20px",
    borderRadius: "5px",
    border: "none",
    backgroundColor: "#4CAF50",
    color: "white",
    cursor: "pointer",
    fontSize: "16px",
  },
  noHabits: {
    color: "#777",
    fontStyle: "italic",
  },
  habitList: {
    display: "flex",
    flexDirection: "column",
    gap: "15px",
  },
  habitItem: {
    display: "flex",
    alignItems: "center",
    justifyContent: "space-between",
    padding: "10px",
    border: "1px solid #ddd",
    borderRadius: "8px",
  },
  habitName: {
    flex: "1",
    textAlign: "left",
    fontWeight: "bold",
  },
  daysContainer: {
    display: "flex",
    gap: "5px",
  },
  dayBox: {
    width: "40px",
    height: "40px",
    lineHeight: "40px",
    borderRadius: "5px",
    cursor: "pointer",
    userSelect: "none",
  },
  deleteButton: {
    marginLeft: "10px",
    backgroundColor: "red",
    color: "white",
    border: "none",
    borderRadius: "5px",
    cursor: "pointer",
    padding: "5px 10px",
  },
};

export default MainPage;
